import React, { useEffect } from "react";
import "./App.css";
import Search from "./components/search";
import { getData } from "./utility/data.utilits";

type productData = {
    data: Product[];
};
type Product = {
    id: string;
    name: string;
    year: number;
    color: string;
    pantoneValue: string;
};

const App = () => {
    useEffect(() => {
        const fetchData = async () => {
            const data = await getData<productData>(
                "https://reqres.in/api/products"
            );
            return data;
        };

        console.log(data);
    });
    return (
        <>
            <Search placeholder="esa" />
        </>
    );
};

export default App;
